import styled from "styled-components";


export const Container = styled.div`
    
    padding-top: 10rem ;
	/* @media screen and (max-width: 768px) {
        height: auto;
        padding: 0rem 8rem;
        padding-top: 10rem;
    }

    @media screen and (max-width: 480px) {
        height: auto;
        padding: 0rem 4rem;
        padding-top: 8rem;
    } */

`
